def extract_bits(byte: int):
    return [byte]


def image_matrix(image: bytearray, width=128, height=64) -> List[List[str]]:
    matrix = [["" for _ in range(width)] for _ in range(height)]

    for byte_index, byte in enumerate(image):
        column = byte_index % width
        row_start = 8 * (byte_index // width)

        for i in range(8):
            row = row_start + i
            pixel = "#" if (byte >> i) % 2 == 0 else " "
            matrix[row][column] = pixel

    return matrix


def render_image(matrix: List[List[str]]) -> str:
    return "\n".join(["".join(row) for row in matrix])


